import React, { useState, useEffect } from 'react';
import hopechain_backend from './ic-service';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    async function fetchData() {
      const result = await hopechain_backend.getTotalCharityAmount();
      setData(result);
    }
    fetchData();
  }, []);

  return (
    <div>
      <h1>Data from Backend: {data}</h1>
    </div>
  );
}

export default App;
